function get(url) {
	if (!url) return false;
	var req = new XMLHttpRequest();
	req.open("GET", url, false);
	req.setRequestHeader('Cache-Control', 'max-age=0');
	try {
		req.send();
		if (req.status != 200 && req.status != 301 && req.status != 302 && req.status != 304) return false;
		if (url.includes("savedata") && req.status == 404) return "0";
		return req.responseText;
	}
	catch (err) {
        alert(err);
		return false;
	}
}
function isWebGLSupported() { 
	try {
		var canvas = document.createElement('canvas'); 
		var s = !!window.WebGLRenderingContext && (canvas.getContext('webgl') || canvas.getContext('experimental-webgl'));
		canvas.remove();
		return s;
	} catch(e) {
		return false;
	}
};

